#include <iostream>#include<vector>using namespace std;typedef long long ll; ll digitSum(int x){      int ans=0;      while(x>0)      {            ans+=x%10;            x/=10;      }      return ans;} int solve(int n){      int count=0;       for(int d=1;d<=200;d++)      {            if(digitSum(n+d)==d)            {                  count++;            }      }       return count;        } int main(){       int t;      cin >> t;      while (t-- > 0)      {             int n;            cin>>n;                         cout<<solve(n)<<endl;      }      return 0;}